import React, { Component } from "react";
import "../Css/Home.css";

class Home extends Component {

  renderPost = () => (
    <div className="post-loading">
      Multimedia student and a self-learning programmer through interesting projects.
    </div>
  )

  renderIntro = () => (
    <div className="intro">
      This is a test sentance
    </div>
  )

  render() {
    return (
      <div>
      <div className="bg">
        <h1 className="name">Mihkel Liblikman</h1>
            <div className="post-container">
              {this.renderPost()}
            </div><br/>
      </div>
            <div className="intro">
              {this.renderIntro()}
            </div>
      </div>

    );
  }
}

export default Home;
